function average_char_distance(string $password): array {
    global $overall_result, $AVERAGE_CHAR_DISTANCE, $AVERAGE_CHAR_DISTANCE_SUM;
    $count = 0.0;

    // Count distance between character duos
    for ($i=0; $i < mb_strlen($password) - 1; $i++) { 
        $a = mb_substr($password, $i, 1);
        $b = mb_substr($password, $i + 1, 1);
        $count += abs(mb_ord($a) - mb_ord($b));
    }

    // Get average value
    $count /= (mb_strlen($password) - 1);
    $count = strval(floor($count));

    if (array_key_exists($count, $AVERAGE_CHAR_DISTANCE)) {
        $res = $AVERAGE_CHAR_DISTANCE[$count];
        $overall_result += ($res[1] / $AVERAGE_CHAR_DISTANCE_SUM);
        return array(
            'average_char_distance_occurrences' => array(
                $count => $res[0]
            )
        );
    }

    return array(
        'average_char_distance_occurrences' => array(
            $count => 0
        )
    );
}

