    global $overall_result, $FIRST_CHAR_FREQ, $FIRST_CHAR_FREQ_SUM;
    $f_char = mb_substr($password, 0, 1);
    if (array_key_exists($f_char, $FIRST_CHAR_FREQ)) {
        $res = $FIRST_CHAR_FREQ[$f_char];
        $overall_result += ($res[1] / $FIRST_CHAR_FREQ_SUM);
        return array(
            'first_char_occurrences' => array(
                $f_char => $res[0]
            )
        );
    }

    return array(
        'first_char_occurrences' => array(
            $f_char => 0
        )
    );
}

function single_char_freq(string $password): array {
    global $overall_result, $CHAR_FREQ, $CHAR_FREQ_SUM;
    $single_char_occurrences = array();
    $count = 0.0;

    for ($i=0; $i < mb_strlen($password); $i++) { 
        $char = mb_substr($password, $i, 1);

        if (array_key_exists($char, $CHAR_FREQ)) {
            $res = $CHAR_FREQ[$char];
            $count += ($res[1] / $CHAR_FREQ_SUM);
            $single_char_occurrences[$char] = $res[0];
        } else {
            $single_char_occurrences[$char] = 0;
        }
    }

    $overall_result += ($count / mb_strlen($password));
    return array(
        'single_char_occurences' => $single_char_occurrences
    );
}

function simple_analysis(string $password): array {
    global $overall_result;
    $overall_result = 0.0;

    $avg_char_dist = average_char_distance($password);
    $duo_char_freq = duo_char_frequency($password);
    $pass_length = password_length($password);
    $first_char_freq = first_char_freq($password);
    $single_char_freq = single_char_freq($password);

    return array_merge(array('result' => ($overall_result / 5.0)), $avg_char_dist, $duo_char_freq, $pass_length, $first_char_freq, $single_char_freq);
}

